import './App.css';
import {Table} from './components/table';
import {Fragment} from 'react';

function App() {
  return (
    <Fragment>
      <tr className='contacts-table'>Список контактов</tr>
      <Table />
      <button className='add-contact'>Добавить контакт</button>
      <form action='' className='form-contact'>Данные контакта
        <label htmlFor='contact-name'>Имя</label>
        <input type='text' id='contact-name' name='contact-name'/>
        <label htmlFor='contact-surname'>Фамилия</label>
        <input type='text' id='contact-surname' name='contact-surname'/>
        <label htmlFor='contact-phone'>Телефон</label>
        <input type='tel' id='contact-phone' name='contact-phone'/>
      </form>
    </Fragment>
  );
}

export default App;
